const Processor = require('../src/processor');

test('process event', async () => {
  const fakeLogger = console;
  const fakeApiClient = {};

  const event = {
    asset_id: 123,
    company_id: 1234,
    properties: {
      foo: 'bar',
    },
  };

  const processor = new Processor({ logger: fakeLogger, apiClient: fakeApiClient });

  await processor.process({ event });
});
